    // обычные стили\n    '(?<!(.+\\\\.(module|m)))(\\\\.css|\\\\.scss)$': '<rootDir>/.jest/transforms/empty.js',\n\n    // asset'ы\n    '\\\\.(apng|avif|gif|jpg|jpeg|png|webp)$': '<rootDir>/.jest/transforms/asset.js',\n  },\n  transformIgnorePatterns: [\n    // из некоторых пакетов мы берем стили так что игнорируем только скрипты\n    '/node_modules/.+js$',\n  ],\n};\n```\n"}),Nx(Nv({},g,Nj),{source:"import { ColorsPicker } from './colors/usage.tsx';\n\n<ColorsPicker />\n"}),Nx(Nv({},v,NS),{source:"import { GradientPicker } from './gradients/usage.tsx';\n\n<GradientPicker />\n"}),Nx(Nv({},x,NO),{source:"import { useBreakpoint } from '@sima-land/ui-nucleons/hooks';\nimport { CSSProperties } from 'react';\n\nexport const meta = {\n  title: 'Простой пример',\n  category: 'Хуки/useBreakpoint',\n};\n\nconst styles = {\n  indicator: {\n    height: '100px',\n    display: 'flex',\n    alignItems: 'center',\n    justifyContent: 'center',\n    borderRadius: '12px',\n    marginBottom: '12px',\n    transition: 'background .2s ease-out',\n    background: '#f5f5f5',\n  } satisfies CSSProperties,\n\n  active: {\n    background: '#00ff0032',\n  } satisfies CSSProperties,\n};\n\nfunction Indicator({ query }: { query: string }) {\n  const matches = useBreakpoint(query);\n\n  return (\n    <div style={{ ...styles.indicator, ...(matches && styles.active) }}>\n      {matches ? '✅' : '❌'} {query}\n    </div>\n  );\n}\n\nexport default function () {\n  return (\n    <>\n      <Indicator query='xs+' />\n      <Indicator query='xs-' />\n    </>\n  );\n}\n"}),Nx(Nv({},w,Nk),{source:"import { useIntersection } from '@sima-land/ui-nucleons/hooks';\nimport { COLORS } from '@sima-land/ui-nucleons/colors';\nimport { CSSProperties, useMemo, useRef, useState } from 'react';\n\nexport const meta = {\n  title: 'Простой пример',\n  category: 'Хуки/useIntersection',\n};\n\nconst styles = {\n  grid: {\n    maxWidth: '1024px',\n    margin: '0 auto',\n    padding: '16px',\n    display: 'grid',\n    gridTemplateColumns: 'repeat(4, 1fr)',\n    gap: '8px',\n  } satisfies CSSProperties,\n\n  title: {\n    gridRow: '1',\n    gridColumn: '1 / 5',\n  } satisfies CSSProperties,\n\n  item: {\n    aspectRatio: '1 / 1',\n    background: COLORS.get('basic-gray12'),\n    borderRadius: '8px',\n    transition: 'background 0.2s ease-in-out',\n  } satisfies CSSProperties,\n};\n\nfunction Item() {\n  const ref = useRef<HTMLDivElement>(null);\n  const [viewing, setViewing] = useState<boolean>(false);\n\n  // ВАЖНО: используем useMemo чтобы не пересоздавать observer при каждом рендере\n  const options = useMemo<IntersectionObserverInit>(() => ({ threshold: 1 }), []);\n\n  useIntersection(\n    ref,\n    entry => {\n      setViewing(entry.isIntersecting);\n    },\n    options,\n  );\n\n  const style: CSSProperties = {\n    ...styles.item,\n    ...(viewing && { background: COLORS.get('basic-blue') }),\n  };\n\n  return <div ref={ref} style={style}></div>;\n}\n\nexport default function () {\n  return (\n    <>\n      <div style={styles.grid}>\n        <h3 style={styles.title}>Квадраты, которые полностью видны будут синими</h3>\n        {[...Array(500).keys()].map(index => (\n          <Item key={index} />\n        ))}\n      </div>\n    </>\n  );\n}\n"}),Nx(Nv({},j,NP),{source:"import { useKeydown } from '@sima-land/ui-nucleons/hooks';\nimport { getDeclination } from '@sima-land/ui-nucleons/helpers/get-declination';\nimport { useState } from 'react';\n\nexport const meta = {\n  category: 'Хуки/useKeydown',\n  title: 'Простой пример',\n};\n\nexport default function Primary() {\n  const [count, setCount] = useState<number>(0);\n  const key = 'Space';\n\n  useKeydown(key, () => {\n    setCount(c => c + 1);\n  });\n\n  return (\n    <>\n      Клавиша {key} была нажата {count} {getDeclination(count, ['раз', 'раза', 'раз'])}\n    </>\n  );\n}\n"}),Nx(Nv({},S,NC),{source:"import { Accordion } from '@sima-land/ui-nucleons/accordion';\nimport { Select } from '@sima-land/ui-nucleons/select';\nimpo